import React, { Component } from 'react'
import "../../Css/Profile.css";

import { connect } from 'react-redux';
// import PropTypes from 'prop-types';
// import { getIndividualProfile } from '../../actions/profileAction.js';

import Spinner from '../../Spinner.js'


 class Profile extends Component {

    componentWillReceiveProps(nextProps){
          
                this.setState({
                     profile: nextProps.profile,
                });
                
     }
    render() {
        const { individualProfile, loading} = this.props.profile; 
            let Allprojects;

    if (individualProfile === null || loading) {
      Allprojects = <Spinner />;
    } else {
      Allprojects = <h1>Yes ,There is Profile his name is {individualProfile.name}</h1>;
    }
          
        return (
             <div>
                {Allprojects}
            </div>
        )
    }
}


Profile.propTypes = {
};

const mapStateToProps = (state) => ({
  profile: state.profile,
});
export default connect(mapStateToProps, {   })(Profile);
